import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 className='Player-Name'>Spotify Webplayer</h1>
        <video id='video' onPlay={ Hls() } controls autoPlay>Could not locate file</video>
      </header>
    </div>
  );
}

function Hls() {
  return <image>Not found</image>
}

export default App;
